INSERT INTO `dbproduct` (`TenSP`, `MaSP`, `NhaSX`, `SDT`, `DiaChi`, `QuanHuyen`, `TinhTP`, `Email`, `MaDN`, `TTSP`, `Note`) VALUES
('Gạo Ông Cua ST25 Chính Hãng Túi PE 5Kg', 'ONGCUA01', 'DOANH NGHIỆP TƯ NHÂN HỒ QUANG TRÍ', '0907709177', '196 Đường Tỉnh Lộ 1, Ấp Hà Bô', 'Trần Đề', 'Sóc Trăng', 'quantrist@gmail.com', '2200562867', '<strong style=\"display: block;text-align: center;\">Kỹ sư Hồ Quang Cua - Từ cây lúa lạ đến giống gạo ngon nhất thế giới</strong>Những năm qua, người tiêu dùng trong nước rất ấn tượng với thương hiệu gạo thơm Sóc Trăng (ST) của kỹ sư Hồ Quang Cua cùng các cộng sự. Đặc biệt hơn, gạo mang thương hiệu ST của ông đã chinh phục đỉnh cao trong làng gạo ngon thế giới.<br> Năm 2017, tại Hội nghị quốc tế lần 9 về mua bán gạo do tổ chức The Rice Trader (Tổ chức thương mại gạo) tổ chức tại Ma Cao, trước các chuyên gia ẩm thực nổi tiếng của thế giới, gạo ST24 có những phẩm chất vượt trội như ngắn ngày, hạt gạo dài, trắng trong, dẻo cơm, thơm thoảng hương lá dứa... đã được chọn và vinh danh là một trong 3 loại gạo ngon nhất theo tiêu chuẩn gạo ngon thế giới và giải Nhất gạo ST24 hữu cơ tại Festival Lúa gạo Việt Nam lần thứ III - Long An năm 2018.<br> Vào năm 2019, tại Cuộc thi Gạo ngon nhất thế giới (World\'s Best Rice do The Rice Trader) tổ chức trong khuôn khổ hội nghị Thương mại Gạo Thế giới lần thứ 11 tại Manila (Philippines) từ ngày 10 - 13/11, với sự tham gia của hơn 20 doanh nghiệp kinh doanh gạo quốc tế, Việt Nam cùng hàng trăm nhà xuất nhập khẩu gạo lớn trên thế giới đã quy tụ về đây tranh tài.<br> Kết quả, gạo ST25 của doanh nghiệp Hồ Quang (Sóc Trăng) đã xuất sắc vượt qua gạo Thái Lan, giành giải Nhất cuộc thi gạo ngon nhất thế giới 2019.<br> Gạo ST25 được bình chọn là gạo đạt chuẩn hạt dài, trắng trong, không bạc bụng, khi nấu cơm dẻo thơm, khi để nguội cơm vẫn ngon, không bị cứng. <br>Theo đánh giá của nhiều người, gạo ST25 là loại gạo thuộc nhóm hảo hạng trong thị trường gạo hiện nay. Đặc biệt, loại gạo này có hàm lượng đạm cao nên phù hợp với người mắc bệnh đái tháo đường, cả người già và trẻ em. Đây cũng là loại đặc sản nổi tiếng ở Sóc Trăng, được người tiêu dùng rất ưa chuộng. <br>Về đặc tính, ST25 là giống lúa cứng và cao cây (110cm - 115cm), lá xanh bền, lâu tàn nên nuôi hạt tốt, thân cứng nếu bón phân cân đối không đổ ngã. Giống lúa này không nhiễm bệnh sọc trong, đạo ôn lá và khoan cổ bông... Trong điều kiện thời tiết tốt, năng suất ST25 có thể đạt 8,5 tấn/ha, trung bình khoảng 6 - 7 tấn/ha. <br> Việc được vinh danh đứng đầu thế giới lần này khẳng định vị thế chất lượng gạo Việt Nam không thua kém gì các nước khác. Thậm chí có nhiều ưu điểm hơn như năng suất cao hơn, chống chịu với điều kiện khí hậu khắc nghiệt, canh tác được nhiều vụ trong năm… <br>Gạo ST25 đã “đóng dấu” được tên tuổi của mình trong lòng các nhà khoa học, nhà nhập khẩu và các đầu bếp nổi tiếng thế giới, nhưng để trở thành một thương hiệu gạo Việt Nam mạnh trên thị trường thế giới vẫn còn không ít việc để làm.<br> Với thắng lợi này, ngành lúa gạo Việt Nam đã khẳng định được vị thế của mình trên thị trường quốc tế, đồng thời thể hiện năng lực sản xuất và quyết tâm xây dựng thương hiệu gạo Việt ra thế giới. Công lao này có sự đóng góp rất lớn của kỹ sư Hồ Quang Cua.<br>Không chỉ nghiên cứu lai tạo, nhân giống và quảng bá thương hiệu, kỹ sư Hồ Quang Cua còn tiên phong trong việc đưa chế phẩm sinh học vào quy trình sản xuất lúa thơm ST để sản phẩm không chỉ ngon mà còn an toàn cho người tiêu dùng và thân thiện với môi trường. <br>Nhiều nông dân ở huyện Mỹ Xuyên mang ơn ông khi ông đã làm sống lại mô hình “con tôm ôm cây lúa” trên những vùng đất nuôi tôm kém hiệu quả tại huyện này và cho ra đời sản phẩm “gạo ngon - tôm sạch”.<br>Ông Cua còn tổ chức những cuộc hội thảo, tham quan đánh giá giống và những cuộc thi “cơm nào ngon hơn”, “cơm ngon thương hiệu Việt”,... nhằm quảng bá cho lúa thơm ST. <br>Lúa thơm ST đã góp phần đưa sản lượng lúa ở tỉnh Sóc Trăng có sự bứt phá ngoạn mục. Năm 2017, tổng sản lượng lúa toàn tỉnh đạt trên 2 triệu tấn; trong đó, lúa thơm và lúa đặc sản chiếm trên 50%; năm 2018, tổng sản lượng lúa đạt trên 2,1 triệu tấn; năm 2019, sản lượng lúa cũng đạt trên 2 triệu tấn, lúa đặc sản ước đạt trên 1 triệu tấn.<br>Cây lúa Sóc Trăng trở thành một trong những chỉ dẫn địa lý hấp dẫn về lúa thơm trong cả nước, vươn lên tốp đầu những tỉnh sản xuất lúa lớn nhất trong khu vực ĐBSCL, giúp hàng chục nghìn hộ dân thoát nghèo. <br>Kỹ sư Hồ Quang Cua tâm sự: “Việt Nam nổi tiếng với gạo thơm, giá rẻ so với gạo của các nước láng giềng như Thái Lan, Campuchia,… Tuy nhiên, việc tổ chức sản xuất lúa ở Việt Nam vẫn còn rất yếu.<br>Theo tôi, đây là cơ hội lớn để chúng ta sắp xếp lại mọi việc. Từ lâu, gạo thơm ST được người tiêu dùng tin chọn, thay thế cho các loại gạo của Thái Lan, Campuchia,...”.<br>Đầu tháng 12/2019, đoàn công tác của Bộ Nông nghiệp và Phát triển nông thôn (NN&PTNT) do Bộ trưởng Nguyễn Xuân Cường dẫn đầu đã làm việc với lãnh đạo tỉnh Sóc Trăng. Bộ trưởng Bộ NN&PTNT Nguyễn Xuân Cường đánh giá: Sóc Trăng đã triển khai thực hiện tái cơ cấu ngành nông nghiệp đạt nhiều thành tựu nổi bật, thể hiện rõ qua việc tăng diện tích cây lúa đặc sản, chuyển đổi cây trồng kém hiệu quả sang trồng cây ăn trái và đặc biệt mô hình tôm - lúa bền vững tại huyện Mỹ Xuyên và việc lựa chọn giống lúa ST sản xuất trên nền đất nuôi tôm, nâng cao chất lượng hạt lúa.<br>Bộ trưởng cũng đề nghị Thứ trưởng Bộ NN&PTNT Lê Quốc Doanh chỉ đạo cơ quan chuyên môn của Bộ và tỉnh Sóc Trăng xây dựng được thương hiệu lúa - tôm cho tỉnh Sóc Trăng; đề nghị nhóm nghiên cứu của kỹ sư Hồ Quang Cua tiếp tục tham gia vào đề án lúa chất lượng cao của tỉnh.', ''),
